import { put, takeLatest, all } from 'redux-saga/effects';
import * as types from '../action-types/homepage';
import { getCustomerPictures } from '../services/homepage';
import { getCustomerPicturesSuccess } from '../actions/homepage';


function* getHomepage() {
  const customerPictures = yield getCustomerPictures();
  yield put(getCustomerPicturesSuccess(customerPictures.data));
}

// watchers --------------------------------------------------------

function* getHomepageWatcher() {
  yield takeLatest(types.GET_HOMEPAGE, getHomepage);
}

export default function* homepageSaga() {
  yield all([
    getHomepageWatcher(),
  ]);
}
